	return g();
}

trace("functionInnerParametersTest");
function outfunc() {
	var g = function (a,x){
		var b = a + 3 + x;

		var f = function (){
			var c = a + 2;
			trace(c);
			return c;
		}
		return f();
	}
	return g(5,2);
}

