	}
	trace("after");
}

function testFunc4(){		
	for (var v in obj) {
		if (v == "b") {
			trace("hi");			
			break;
		}
		if(v == "c"){
			trace("hello");
			break;
		}
		trace("hohoho");
	}
	trace("after");
}

function testFunc5(){		
	var obj2 = {key1:1,key2:2,key3:3};
	for (var v in obj) {
		if (v == "a") {
			trace("loop1_break");
			break;
		}
		if(v == "b"){
			trace("hello");
			for (var v2 in obj2) {
				if(v2 == "key1"){
					trace("loop2_break");
					break;
				}
				trace("loop2_inside");
			}			
			trace("after_loop2");
		}
		trace("loop1_inside");
	}
	trace("after_loop1");
}

function testFunc6(){
	var obj2 = {key1:1,key2:2,key3:3};
	for (var v in obj) {
		if (v == "a") {
			trace("loop1_break");
			break;
		}
		trace("hello");
		for (var v2 in obj2) {
			if(v2 == "key1"){
				trace("loop2_break");
				break;
			}
			trace("loop2_inside");
		}			
		trace("after_loop2");			
	}
	trace("after_loop1");
}

