trace("registersVsDefineLocalTest");

function x1(c){
	//these are generated as registers
	var a = 1;
	var b = 2;

	return a+b*c;
}

function x2(c){
	var a0 = 1;
	var a1 = 2;
	var r = Math.floor(Math.random() * 2);

	return eval("a"+r)+b*c; //eval triggers using DefineLocal
}

function x3(c){
	var a0 = 1;
	var a1 = 2;
	var r = Math.floor(Math.random() * 2);
	set("a"+r, 12); //set does not trigger using DefineLocal - it will fail
	return a0+b*c;
}


trace(x1(2)+x2(3)+x3(4));

